import React, { Component } from 'react'

export class hoverjs extends Component {
    constructor(props) {
        super(props)
    
        this.state = {
             count:0
        }
        
    }
    IncrementCounter=()=>{
      return  this.setState(prv=>{
            return{count:prv.count+1}
        })
    }
    render() {
        const {count}=this.state
        return (
            <div>
                <h1 onMouseOver={this.IncrementCounter}>Hii am Dipen  {count} </h1>
            </div>
        )
    }
}

export default hoverjs
